import React from 'react';
import './App.css';
import TradingViewWidget from 'react-tradingview-widget';

function App() {

let small = TradingViewWidget.width = 'auto'
let heighty = TradingViewWidget.height = '300px'
let themey = TradingViewWidget.theme = 'Dark' ;
let interval = TradingViewWidget.interval= "180" ;
let indicators =  TradingViewWidget.studies = [ "Volume@tv-basicstudies",  "TripleEMA@tv-basicstudies",  "MASimple@tv-basicstudies"]

// console.log(Trading)
// console.log(typeof Trading)
// console.log(Trading.width)
// console.log(indicators[0])

return (

<div className="App">

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={small}
    height={heighty}
    style='8'
    interval="180"
    studies={indicators}          
/>

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={small}
    height={heighty}
    style='8'
    interval="180"
    studies={indicators}           
  />

<TradingViewWidget
    symbol="BITSTAMP:LTCUSD"
    theme= {themey}
    // theme={Themes.DARK}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={small}
    height={heighty}
    style='8'
    interval="180"
    studies={indicators}         
  />


</div>

);
}

export default App;
